        self.max_size = max_size
        self.queue = []
        self.pending = set()
        self.running = set()
        self.completed = set()
        self.failed = set()
        self.cancelled = set()
        self.shutdown = False

    def submit_task(self, func, args, priority=0):
        if self.shutdown:
            raise ShutdownError('TaskQueue is shutting down')
        if len(self.queue) >= self.max_size:
            raise QueueOverflowError('Task queue is full')
        task = (priority, func, args)
        heapq.heappush(self.queue, task)
        self.pending.add(task)
        return task

    async def process_tasks(self, worker_count):
        workers = [asyncio.create_task(self.worker()) for _ in range(worker_count)]
        await asyncio.gather(*workers)
        self.shutdown = True

    async def worker(self):
        while not self.shutdown:
            try:
                priority, func, args = heapq.heappop(self.queue)
            except IndexError:
                return
            self.pending.remove((priority, func, args))
            self.running.add((priority, func, args))
            try:
                result = await func(*args)
                self.running.remove((priority, func, args))
                self.completed.add((priority, func, args))
            except asyncio.CancelledError:
                self.running.remove((priority, func, args))
                self.cancelled.add((priority, func, args))
            except Exception as e:
                self.running.remove((priority, func, args))
                self.failed.add((priority, func, args))
                raise e

    def get_task_status(self, task):
        if task in self.pending:
            return 'pending'
